import React from 'react';
import catlogo from './cat_img.png';
import './header.scss';

function Header() {
    return (
    <div>
        <img src={catlogo} alt="logo" />
        <button className='btn'>Users</button>
        <button>Sign up</button> 
    </div>
    )   
}
export default Header;
